import React,{Component} from 'react';

function NameList(){
	const persons = [
		{
			id:'1',
			name : 'Bob'
		},
		{
			id:'2',
            name:'diana'
		}
		]
        const personsList = persons.map((person) =>  <Person person = {person} />)
    return (<div>{personsList}</div>)
}	
export default NameList
